import React from 'react'
import moment from 'moment'
import Nav from './Nav'
import DataDisplay from './MovementDataDisplay'

class App extends React.Component {
  constructor() {
    super();

    this.state = {appDate:moment().format("1995-12-25", "YYYY-MM-DD"),apiData:''}
  }

  componentDidMount() {
    console.log(this.state.appDate)
    get('https://tharsus-interview-api-v1.azurewebsites.net/data/2019-10-19')
    .then(response => response.json())
    .then(data => {
      this.setState({apiData:data})
    })
    console.log(this.state.apiData)
  }

  render() {
    return(
      <div>
        <Nav />
         <DataDisplay apiData={[3.3176110809420893, 4.18238891905791]}/>  {/* From here can pass in 'data' prop from api call for display in table */}
      </div>
    )
  }
}

export default App;
